Autisme Autisme utawa lelarat autis yaiku sawijining gangguan perkembangan bocah kang kompleks.[1] Tandha - tandhane wis katon nalika bocah durung ngancik 3 taun. [1] Sebab autis yaiku gangguan neurobiologis sing bisa ganggu fungsi otak saengga bocah mau ora bisa komunikasi kanthi lancar karo wong liya.[1] Autisma/Autisme dumadi saka tembung auto kang duwèni teges dhéwé. Istilah Autisme lagi kondhang wiwit taun 1943 déning Leo Kanner, senajan lelara iki wis ditemokaké wiwit biyen (Handojo,2003).
